import './App.css';
import Login from './components/Login'

function App() {
  return (
    <div className="App">
      <Login name = "KBS">
        <p>Hello this an react app</p>
        <button className="btn btn-outline-primary">Submit</button>
      </Login>
    </div>
  );
}

export default App;
